import { List } from './Feedback.styled';

export const Feedback = onClick => {
  render();
  {
    return (
      <div>
        <h2>Please leave feedback</h2>
        <List>
          <button type="button" onClick={handleAddFeedback}>
            Good
          </button>
          <button type="button" onClick={handleAddFeedback}>
            Neutural
          </button>
          <button type="button" onClick={handleAddFeedback}>
            Bad
          </button>
        </List>
      </div>
    );
  }
};
